window.bookSummaryJSON = "<p><b><i>From NYT best-selling author Thea Harrison comes the explosive conclusion to The Unseen!</i></b></p> <p>When Dragos and Pia move to the Other land of Rhyacia, they hope starting a new life will bring safety and freedom to their family, especially their young baby, Niall. And at first their new home seems perfect...but looks are deceiving.</p> <p>Beneath Rhyacia’s idyllic façade an ancient, malevolent force lurks, waiting for the right opportunity to break free of its cage. When that opportunity comes, it strikes with devastating accuracy.</p> <p>While Dragos has never backed down from a fight, he’s also never encountered an enemy like this one before. How can he fight a foe who doesn’t have a body? A foe who can invade and turn his own mind against him?</p> <p>How can Dragos protect his family, when at any moment one of them may become the enemy?</p> <p>As Dragos and Pia race against time to fight this unseen menace, they must also acknowledge a terrifying truth - when anyone can become the enemy, no one can be trusted.</p> <p><i>An adversary who can trap the dragon poses a threat to everyone in Rhyacia, and that means no one is safe....</i></p> <p><b>This book does NOT end on a cliffhanger.</b></p>"; 
